font-weight: 400;
font-size: 14px;
line-height: 20px;
`
const FirstGraphicBlock = styled.div`
width: 545px;
display: grid;
row-gap: 14px;
grid-auto-rows: 40px;
    .first-row {
    display: grid;
    column-gap: 8px;
    grid-template-columns: 200px 140px 163px;
    }
    .second-row {
    display: grid;
    column-gap: 8px;
